import java.util.PriorityQueue;

public class Main {
    public static void main(String[] args) {
        PriorityQueue<Integer> pq = new PriorityQueue<>();

        // Adding random elements to the PriorityQueue
        pq.offer(100);
        pq.offer(1);
        pq.offer(50);

        // Intermediate computations
        int variable = (int) (Math.random() * 100);

        // Conditionally adding to the PriorityQueue - the correct write
        if (variable < 50) {
            /* write */ pq.offer(-10);
        } else {
            pq.offer(25);
        }

        // Adding elements to confuse static analysis
        pq.offer(5);
        pq.offer(20);
        pq.offer(15);

        // Remove elements from the queue
        pq.poll(); // Though we remove, this doesn't affect the read value
        pq.poll();

        // Read from the PriorityQueue
        /* read */ int ret = pq.peek();

        // Output to see the result
        System.out.println("Read value from PriorityQueue: " + ret);
    }
}
